import React, { useEffect } from 'react'

const Main = props => {
    useEffect(() => {
        console.log(props.location.state)
    })

    return (
        <div>
            <h1>Main</h1>
            <p>{props.location.stateaccessToken}</p>
            <p>{props.location.staterefreshToken}</p>
        </div>
    )
}

export default Main
